import * as tfjs from '@tensorflow/tfjs'
import React from 'react'
const tfnode = require('@tensorflow/tfjs-node')

let model = null
let handler = tfnode.io.fileSystem('modelJS/model.json')
model = tfjs.loadLayersModel(handler)

const Main = () => {

	if (model == null) 
		console.log('model loaded')
	return null
}

export default Main;
